Over America

Travel Documentary hosted by Tom Skerritt, published by PBS in 2010 - English narration


Information
------------------------------

Over America
In this breathtaking DVD, some of the greatest cinematographers and photographers working in the industry capture hours of footage of lush American landscapes and cityscapes from the unparalleled aerial perspective. The program flies viewers over such varied areas as New York, Washington D.C., Arizona, Florida, Over New England and Over California. If you enjoyed Visions of Europe you will enjoy this series.




5)  Washington 
Take to the sky and come face-to-face with Washington states majestic mountains, including one of the Pacific Northwest's most well-known symbols: Mount Rainier. Celebrate the diversity of the states landscapes in Over Washington, from the glittering Puget Sound in the west to the rolling Palouse in the east. Stunning aerial cinematography and original music bring these spectacular images to life.



